import "./Cost.css";
import CostItem from "./CostItem";

function Cost(props) {
   return (
     <div>
       <h1>Начинаем изучение React</h1>
       <CostItem
         date={props.cost[0].date}
         description={props.cost[0].description}
         amount={cost[0].amount}
       />
       <CostItem
         date={cost[1].date}
         description={cost[1].description}
         amount={cost[1].amount}
       />
       <CostItem
         date={cost[2].date}
         description={cost[2].description}
         amount={cost[2].amount}
       />
     </div>
   );
}

export default Cost
